import React from 'react';
// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className ="App">
    <input type="text" aria-required="true" size="80" value="" name="Search Repo" placeholder="Search Repo" style="width: 1300px; height: 30px;" />
    <button style="width: 80px; height: 30px;">Search</button>
</div>

  );
}

export default App;
